    false,nt"url": null,nt"notes": "Operations will use the shipu00c3u00a2u00c2u0080u00c2u0099s
    deep water mapping systems (Kongsberg EM302 multibeam sonar, EK60 split-beam fisheries
    sonars, ADCPs, and Knudsen 3260 chirp sub-bottom profiler sonar), CTD rosette, and
    the shipu00c3u00a2u00c2u0080u00c2u0099s high-bandwidth satellite connection for
    periodic real-time ship to shore communications. Operations for this cruise will
    include 24 hour mapping, periodic telepresence-based remote participation, and CTD
    rosette operations. Multibeam and singlebeam mapping operations will be conducted
    24 hours a day throughout the cruise. Sub-bottom profile mapping will be conducted
    24 hours a day at the discretion of the CO. XBT and/or UnderwayCTD (UCTD) sound
    velocity casts in support of multibeam sonar mapping operations will be conducted
    at an interval defined by prevailing oceanographic conditions, but not to exceed
    6 hours.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
